import { Friend } from "./Friend"
import PropTypes from 'prop-types';

export const FriendListItem = ({items})=>{
  return (<ul>
    {items.map(item =>(
      <li key={item.id}>
        <Friend item={item}/>
      </li>
    ))}
  </ul>
  )
}

FriendList.propTypes = {
  items: PropTypes.arrayOf(
    PropTypes.shape({
    id:PropTypes.number.isRequired,
  })
  ).isRequired,
}
